import React from 'react';
import './ColorBox.css';

export default function ColorBox(props) {
  const { name, background } = props;
  return (
    <div
      style={{ background: props.background }}
      className="ColorBox"
    >
      <div className="copy-container">
        <div className="box-content">
          <span>{ props.name }</span>
        </div>
      </div>
    </div>
  );
}
